import React from "react";
import "../component/component.css";
import "../App.css";

const Header = () => {
  return (
    <>
      <div className="main__header">
        <div className="icon__wrapper">
          <div className="wrapper">==</div>
        </div>
        <div className="logo">
          <p>Disney__Hotstar</p>
        </div>
        <div className="nav__list">
          <div className="list_item">
            <p>TV</p>
          </div>
          <div className="list_item">
            <p>Movies</p>
          </div>
          <div className="list_item">
            <p>Sports</p>
          </div>
          <div className="list_item">
            <p>Disney+</p>
          </div>
        </div>
      </div>
    </>
  );
};

export default Header;
